from random import randint
from numpy.random import normal
from coders.arithmetic import ArithmeticCoder


def test_arithmetic_small():
    data = [randint(0, 7) for _ in range(10000)]
    counts = [0] * 8
    for x in data:
        counts[x] += 1

    coder = ArithmeticCoder()
    stream = coder.encode(data, counts)
    decoded_data = coder.decode(stream, counts, len(data))

    assert data == decoded_data


def test_arithmetic_small_distribution():
    data = [int(round(normal(0, 1))) for _ in range(10000)]
    data = [x for x in data if x >= 0]
    counts = [0] * 8
    for x in data:
        counts[x] += 1

    coder = ArithmeticCoder()
    stream = coder.encode(data, counts)
    decoded_data = coder.decode(stream, counts, len(data))

    assert data == decoded_data


def test_arithmetic_big_distribution():
    data = [int(round(normal(0, 500))) for _ in range(50000)]
    data = [x for x in data if 2 ** 16 > x >= 0]
    counts = [0] * (2 ** 16)
    for x in data:
        counts[x] += 1

    coder = ArithmeticCoder()
    stream = coder.encode(data, counts)
    decoded_data = coder.decode(stream, counts, len(data))
    assert data == decoded_data


